import logo from './logo.svg';
import './App.css';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button'
import variant from '@material-ui/core/Button'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, NavDropdown,Navbar,Form, FormControl} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
          <Navbar.Brand href="#home">JARVIS</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#features">Abonnement</Nav.Link>
              <Nav.Link href="#pricing">Pricing</Nav.Link>
              <Nav.Link href="#pricing">About us</Nav.Link>
            </Nav>
            <Nav>
              <NavDropdown title="connection" id="collasible-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">connection</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">creer compte</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
    </div>
  )
}

export default App;
